import React, { useState, useEffect } from "react";
import 'bootstrap/dist/css/bootstrap.css';
import { Pagination } from "react-bootstrap";
import '../../styles/styles.css';

function NavBar({ question, paginate }) {

    return (
        <div class="navbar">
            <Pagination size='sm'>
                <Pagination.First />
                <Pagination.Prev />
                {question.map(question => (
                    <Pagination.Item onClick={() => paginate(question.question_id)}>
                        {question.question_id}
                    </Pagination.Item>
                ))}
                <Pagination.Next />
                <Pagination.Last />
            </Pagination>
        </div>
    );
};

export default NavBar;
